import React from 'react';
import IoT from './IoT.png'
import './Logo.css';
import anime from 'animejs';

const Logo =()=>
{
	return(
    <div className='ma4 mt0'>
      <div className="pa3"><img alt='logo' src={IoT}/></div>
    <p params = {anime({
  targets: 'div',
  translateX: [
    { value: 100, duration: 1200 },
    { value: 0, duration: 800 }
  ],
  rotate: '1turn',
  backgroundColor: 'linear-gradient(to right, #051937, #004d7a, #008793, #00bf72, #a8eb12);  -webkit-font-smoothing: antialiased',
  duration: 2000,
  loop: true
}) } className='f2'>Internet of Things</p>
    </div>

    );
}

export default Logo;
